  \"2013-03-15T16:35:47.425031\",\n\t\"name\": \"national-assessment-of-oil-and-gas-project-powder-river-basin-province-033-regions-of-oil-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Regions of high or low potential for oil
  and gas resources in the Powder River Basin generally indicate where continuous
  oil and gas resources are more or less likely to be found. These regions are based
  on several kinds of structural features that were plotted using a Geographic Information
  System (GIS) and drawn on a map by an assessment geologist. Structural features
  include faults, anticlines, synclines, and lineaments which may: 1) enhance secondary
  reservoir permeability and 2) provide migration pathways in unconventional rocks.\",\n\t\"license_title\":
